import { createStore } from 'vuex';
import axios from 'axios';

export default createStore({
    state: {
        products: JSON.parse(localStorage.getItem('products')) || [], // Carrega os produtos do localStorage, se existirem
        orders: [],
        users: JSON.parse(localStorage.getItem('users')) || [], // Carregar os usuários do localStorage
        authToken: localStorage.getItem('authToken') || null,
    },
    mutations: {
        // Mutações para os produtos
        setProducts(state, products) {
            state.products = products;
            localStorage.setItem('products', JSON.stringify(products)); // Persiste os produtos no localStorage
        },
        addProduct(state, product) {
            state.products.push(product);
            localStorage.setItem('products', JSON.stringify(state.products)); // Persiste após adicionar
        },
        removeProduct(state, productId) {
            state.products = state.products.filter(product => product.id !== productId);
            localStorage.setItem('products', JSON.stringify(state.products)); // Persiste após remoção
        },
        updateProduct(state, updatedProduct) {
            const index = state.products.findIndex(product => product.id === updatedProduct.id);
            if (index !== -1) {
                state.products.splice(index, 1, updatedProduct);
                localStorage.setItem('products', JSON.stringify(state.products)); // Persiste após atualização
            }
        },

        // Mutações para os usuários
        setUsers(state, users) {
            state.users = users;
            localStorage.setItem('users', JSON.stringify(users)); // Persiste os usuários no localStorage
        },
        addUser(state, user) {
            state.users.push(user);
            localStorage.setItem('users', JSON.stringify(state.users)); // Persiste após adicionar
        },
        removeUser(state, userId) {
            state.users = state.users.filter(user => user.id !== userId);
            localStorage.setItem('users', JSON.stringify(state.users)); // Persiste após remoção
        },
        updateUser(state, updatedUser) {
            const index = state.users.findIndex(user => user.id === updatedUser.id);
            if (index !== -1) {
                state.users.splice(index, 1, updatedUser);
                localStorage.setItem('users', JSON.stringify(state.users)); // Persiste após atualização
            }
        },

        // Mutações de autenticação
        setAuthToken(state, token) {
            state.authToken = token;
            if (token) {
                localStorage.setItem('authToken', token);
            } else {
                localStorage.removeItem('authToken');
            }
        },
    },
    actions: {
        // Ação para buscar produtos
        async fetchProducts({ commit }) {
            try {
                const response = await axios.get('https://fakestoreapi.com/products');
                commit('setProducts', response.data);
            } catch (error) {
                console.error('Erro ao buscar produtos:', error);
            }
        },

        // Ação para buscar pedidos
        async fetchOrders({ commit }) {
            try {
                const response = await axios.get('https://fakestoreapi.com/carts');
                commit('setOrders', response.data);
            } catch (error) {
                console.error('Erro ao buscar pedidos:', error);
            }
        },

        // Ação para buscar usuários
        async fetchUsers({ commit }) {
            const users = JSON.parse(localStorage.getItem('users'));

            if (!users) {
                try {
                    const response = await axios.get('https://fakestoreapi.com/users');
                    commit('setUsers', response.data);
                } catch (error) {
                    console.error('Erro ao buscar usuários:', error);
                }
            } else {
                commit('setUsers', users);
            }
        },

        // Ação de login
        async login({ commit }, credentials) {
            try {
                const response = await axios.post('https://fakestoreapi.com/auth/login', credentials);

                // Verifica se a resposta contém o token
                if (response.data && response.data.token) {
                    // Se o login for bem-sucedido, persiste o token
                    commit('setAuthToken', response.data.token);

                    // Não vamos buscar os usuários novamente, apenas usar os dados do localStorage
                    this.$router.push("/");  // Redireciona para a página principal
                } else {
                    console.error('Login falhou: Nenhum token retornado');
                }
            } catch (error) {
                console.error('Erro no login:', error);
                this.errorMessage = "Erro ao fazer login. Verifique suas credenciais ou tente novamente mais tarde.";
            }
        },

        // Ação de logout
        logout({ commit }) {
            commit('setAuthToken', null);  // Limpa o token de autenticação
            this.$router.push('/login');  // Redireciona para a tela de login
        },

        // Ações de produtos
        addProduct({ commit }, product) {
            commit('addProduct', product);
        },
        removeProduct({ commit }, productId) {
            commit('removeProduct', productId);
        },
        updateProduct({ commit }, updatedProduct) {
            commit('updateProduct', updatedProduct);
        },

        // Ações de usuários
        addUser({ commit }, user) {
            commit('addUser', user);
        },
        removeUser({ commit }, userId) {
            commit('removeUser', userId);
        },
        updateUser({ commit }, updatedUser) {
            commit('updateUser', updatedUser);
        },
    },
    getters: {
        isAuthenticated(state) {
            return !!state.authToken;
        },
        getAllProducts(state) {
            return state.products;
        },
        getProductById: (state) => (id) => {
            return state.products.find(product => product.id === id);
        },
        getAllUsers(state) {
            return state.users;
        },
        getUserById: (state) => (id) => {
            return state.users.find(user => user.id === id);
        },
    },
});
